TAKE PROGRESS PICTURES!!

Taking progress pictures is something I cannot stress enough to people. Results are not only measured by the scale! SAY IT WITH ME. “MY PROGRESS IS NOT SOLELY DEFINED BY WHAT THE SCALE SAYS.” 

I’m going to keep it real as always..I totally fell into an unhealthy habit of religiously weighing myself over the past few months. Then this morning I took the first picture you see and went to compare it to a picture I took at the end of October right at the end of 75 Hard (so I stopped taking a progress pictures everyday). I notice that despite the minor difference on the scale, I find myself feeling leaner. I am overall much happier with how my physique is looking. 

So what’s changed? In the second picture, I was just transitioning from being in a bulk to a cutting phase and I was lifting 5-6 times a week while doing about two to three 30min sessions of cardio. Vs the first picture was this morning. For the past 3 months I have been primarily focusing on doings higher intensity training (which I also find myself enjoying significantly more). In actuality there is only a 5-6 pound difference between the 2.

Anyways, long story short..listen to your body. Do what makes you happy, find a healthy balance in your life and do not be so hard on yourself based off what a few numbers are telling you on the scale!! Progress is not linear. Progress takes time and patience!!

And in case you already forgot..do not forget to take your progress pictures!!

Keep grinding this week.
Much love <3 

