If you think you may be over restricting yourself, this post is for you!!

“I can’t eat this.” “I can’t eat that.” “I will eat this instead.” For such a long time I have fallen into such a toxic mindset when it comes to what I allowed myself to eat. I finally hit a point where what I was doing as far as the foods I allowed myself to eat and how much I allowed myself to eat was causing more harm than good. For the past 4 weeks I have been practicing intuitive eating and it has honestly helped me slowly regain a healthy relationship with food again. Obviously it is still a work in progress but I have been making great steps in the right direction. I was so caught up in if I ate certain foods I was “cheating” and neglecting my nutrition and that is not the case. I’ve found more balance and happiness in eating the foods my body wants (in moderation of course) and it’s also helped me break past a weight plateau I was stuck at for so long. Right now I am practicing 4 planned eating days and 3 intuitive eating days. I am loving it. 

If you find yourself paying more attention to the numbers or constantly labeling foods as “good” and “bad” then maybe give intuited eating a shot! 

If you have questions please feel free to each out! It’s all about finding balance and I’m learning everyday what works for me. When I really like something I love to share it in hopes it may help one of you too!❤️

Will be sharing a “what I eat in a day” post soon! 

